import React, {useState} from 'react';

const counter = () => {
   const [count, setCount] = useState(0);


   function increment(){
    setCount (count + 1);
   }

   function decrement(){
    setCount (count + 1);
   }


   return (
    <div>
        <h1>
            {count}
        </h1>
        <h1>
            {setCount}
        </h1>
        <button onClick={increment}></button>
        <button onClick={decrement}></button>
        <input>

        </input>
    </div>
   )
};

export default counter;
